                    { 67, "http://static.sportpaleisgroep.be/sportpaleis/img/events/3044/98effc1370869f81c86ff90dbffa62d3c86bbe14/billboard.jpg", "Daar is-ie dan. De fonkelnieuwe plaat van Bazart! ‘Onderweg’ is al het derde album van de razendpopulaire band rond Mathieu Terryn, Simon Nuytten en Oliver Symons. De heren hebben er de afgelopen maanden enorm hard aan gewerkt en staan te popelen om hun nieuwe muziek nu ook live naar hun publiek te brengen. Dat doen ze deze zomer op Werchter Parklife en dit najaar op vrijdag 19 november in de Antwerpse Lotto Arena. Dat de goesting niet alleen bij Bazart erg groot is, maar ook bij hun fans, bleek uit de ticketverkoop voor beide concerten. Daarom kondigt de indiepopgroep een extra concert aan in de Lotto Arena op zaterdag 20 november.", new DateTime(2021, 11, 20, 19, 30, 0, 0, DateTimeKind.Unspecified), 67, "Bazart", "http://www.lotto-arena.be/nl/kalender/2021-2022/bazart" },
