                    { 65, "https://www.cocoloco-festival.be/content/img/1/1356-24711-cocoloco-festival-311021-697c0f9b70a15985.jpg", "Coco Loco is gekend voor zijn adembenemende show. Zijn buitengewone feestcombinatie tussen een magische halloween, kleurrijk carnaval & vintage circus. Een avond vol sensationele acrobaten & circusartiesten, headliner dj’s en acts, spectaculaire shows en tonnen confetti.", new DateTime(2021, 10, 31, 21, 0, 0, 0, DateTimeKind.Unspecified), 65, "Cocô Loco", "http://www.sportpaleis.be/nl/kalender/2021-2022/coco-loco" },
                    { 64, "http://static.sportpaleisgroep.be/sportpaleis/img/events/2043/473b45b4c412c3cc2119f26af28b2296070a32ac/billboard.jpg", "André Hazes wordt door België omarmd. Wanneer ‘Leef’ klinkt, wordt het glas geheven en de daad bij het woord gevoegd. Haal net als André Hazes alles uit het leven en kom terug op 10 en 11 november 2021 feesten in de Lotto Arena! Beleef samen met vrienden, familie, collega’s een onvergetelijke avond uit!", new DateTime(2021, 11, 13, 19, 30, 0, 0, DateTimeKind.Unspecified), 64, "André Hazes: De avond van je leven", "http://www.lotto-arena.be/nl/kalender/2021-2022/andre-hazes-2020" },
                    { 63, "http://static.sportpaleisgroep.be/sportpaleis/img/events/2043/473b45b4c412c3cc2119f26af28b2296070a32ac/billboard.jpg", "André Hazes wordt door België omarmd. Wanneer ‘Leef’ klinkt, wordt het glas geheven en de daad bij het woord gevoegd. Haal net als André Hazes alles uit het leven en kom terug op 10 en 11 november 2021 feesten in de Lotto Arena! Beleef samen met vrienden, familie, collega’s een onvergetelijke avond uit!", new DateTime(2021, 11, 11, 19, 30, 0, 0, DateTimeKind.Unspecified), 63, "André Hazes: De avond van je leven", "http://www.lotto-arena.be/nl/kalender/2021-2022/andre-hazes-2020" },
                    { 62, "http://static.sportpaleisgroep.be/sportpaleis/img/events/2043/473b45b4c412c3cc2119f26af28b2296070a32ac/billboard.jpg", "André Hazes wordt door België omarmd. Wanneer ‘Leef’ klinkt, wordt het glas geheven en de daad bij het woord gevoegd. Haal net als André Hazes alles uit het leven en kom terug op 10 en 11 november 2021 feesten in de Lotto Arena! Beleef samen met vrienden, familie, collega’s een onvergetelijke avond uit!", new DateTime(2021, 11, 10, 19, 30, 0, 0, DateTimeKind.Unspecified), 62, "André Hazes: De avond van je leven", "http://www.lotto-arena.be/nl/kalender/2021-2022/andre-hazes-2020" },
                    { 61, "http://static.sportpaleisgroep.be/sportpaleis/img/events/2685/d12fb2470eec6533a60ea148470ba89c7c343abf/billboard.jpg", "Het Nederlandse Kensington is in eigen land uitgegroeid tot één van de meest populaire en succesvolste bands. Tal van awards pronken op hun kast: De Popprijs 2017, 3FM Awards, MTV Awards, ‘Song Van Het Jaar 2018’ voor “Slicer”. De band is kind aan huis in de Amsterdamse Ziggo Dome met 13 uitverkochte shows, waarvan 3 in december 2019, en wist als eerste Nederlandse band ook de Johan Cruijff Arena volledig te vullen in 2018. Hun vorige album ‘Control’ (2016) was goed voor drie keer platina.", new DateTime(2021, 11, 5, 20, 0, 0, 0, DateTimeKind.Unspecified), 61, "Kensington", "http://www.lotto-arena.be/nl/kalender/2021-2022/kensington" },
                    { 60, "https://img.static-rmg.be/a/view/q100/w720/h480/3177707/liefdevoormuziekconcert-jpg.jpg", "*Liefde voor Muziek – voor het eerst live op een podium met Tourist LeMC, Emma Bale, Willy Sommers, Cleymans & Van Geel, Geike Arnaert, Bert Ostyn van Absynthe Minded en Ronny Mosuse.", new DateTime(2021, 9, 25, 20, 0, 0, 0, DateTimeKind.Unspecified), 60, "Liefde voor Muziek LIVE", "http://www.lotto-arena.be/nl/kalender/2021-2022/liefde-voor-muziek-live" },
                    { 59, "http://static.sportpaleisgroep.be/sportpaleis/img/events/2630/20ce833a5437ecf4f317c0afb2d4e19b18fad69a/banner.jpg", "De Grungblavers dat zijn Guillaume Van der Stighelen, Jan Van Looveren, Paul “Boogie Boy” Ambach, Gène Bervoets, Erik Goossens, Ludovic Nyamabo, Dirk Cassiers, Marc Fransen, Stany Crets en Nathan “N8N” Ambach. De Grungblavers zingen naar hun moedertaal (zijnde “het Aantwaarps”) vertaalde evergreens en in 2020 zijn ze klaar voor groter en grootst: de Lotto Arena. Ze halen alle toeters en bellen uit de kast, zorg dat je erbij bent op dit unieke concert!", new DateTime(2021, 9, 4, 20, 0, 0, 0, DateTimeKind.Unspecified), 59, "De Grungblavers", "http://www.lotto-arena.be/nl/kalender/2021-2022/de-grungblavers" },
                    { 58, "https://www.frontview-magazine.be/sites/default/files/news/159571-nieuwe-datum-voor-james-blunt-in-lotto-arena-antwerpen-1321908.jpg", "Voor zijn zesde album keerde James Blunt terug naar de basis, en doet hij wat hem in 2005 naar een sterrenstatus katapulteerde: het schrijven van bloedeerlijk en gevoelige songs met een rijke melodie. ‘This is the album of my life’ zegt hij zelf over ‘Once Upon A Mind’. Nooit eerder was hij zo emotioneel betrokken, hij draagt het album dan ook op aan zijn zieke vader. ‘Wanneer je beseft dat je ouders niet onsterfelijk zijn, en je zelf net vader wordt zie je de levenscyclus ineens heel duidelijk.’", new DateTime(2022, 3, 29, 20, 0, 0, 0, DateTimeKind.Unspecified), 58, "James Blunt", "http://www.lotto-arena.be/nl/kalender/2021-2022/james-blunt" }
                });

