                    { 70, "http://static.sportpaleisgroep.be/sportpaleis/img/events/2641/cd1db8d0178c3381b07c6f9691965af3d3591763/billboard.jpg", "De wereld is klaar voor een nieuwe start, zo ook Alex Agnew. Tijdens BCWYWF was er al de #MeToo, het genderdebat, maar plots was daar een virus, Black Lives Matter, en waar zijn die klimaatactivisten naartoe? Benieuwd wat Alex Agnew over deze en nog tal van andere onderwerpen te vertellen heeft?", new DateTime(2021, 9, 11, 20, 0, 0, 0, DateTimeKind.Unspecified), 70, "An Evening with Alex Agnew", "http://www.stadsschouwburg-antwerpen.be/nl/kalender/2021-2022/an-evening-with-alex-agnew" },
                    { 71, "http://static.sportpaleisgroep.be/sportpaleis/img/events/3006/1b4955c85eaba8fb2989dbd498acda51b7530e85/billboard.jpg", "Jimmy vertelt in zijn gloednieuwe show grappen over allerlei verschrikkelijke zaken. Verschrikkelijke zaken waar jij of één van je geliefden misschien mee te maken kreeg. Maar het zijn gewoon grappen – het zijn niet de verschrikkelijke zaken zelf. Politieke correctheid bij een comedy show is zoals gezondheid en veiligheid bij een rodeo.", new DateTime(2021, 9, 16, 19, 30, 0, 0, DateTimeKind.Unspecified), 71, "Jimmy Carr: Terribly Fun", "http://www.stadsschouwburg-antwerpen.be/nl/kalender/2021-2022/jimmy-carr" },
